import './App.css';
import Header from './components/header';
import Navtwo from './components/navtwo';
import Content from './components/content';
import Footer from "./components/footer";

function App() {
  return (
    <div className="App">
      <Header />
      <Navtwo />
      <Content />
      <Footer />
    </div>
  );
}

export default App;
